import React from 'react';
import Grid from '@material-ui/core/Grid';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  root: {
    width: '100%',
    maxWidth: 500,
  },
});

const Landing = () => {
  return (
    <Grid container className={useStyles.root}>
      HI
    </Grid>
  );
};

export default Landing;
